pragma solidity ^0.8.0;

contract Oracle {
    address public owner;
    mapping(uint256 => address) public pendingRequests;

    event RequestUserData(uint256 userId, address requester);
    event FulfillUserData(uint256 userId, string response);

    // Constructor
    constructor() {
        owner = msg.sender;
    }

    modifier onlyOwner() {
        require(msg.sender == owner, "Only the owner can call this");
        _;
    }

    function requestUserData(uint256 userId) external {
        require(pendingRequests[userId] == address(0), "Request already pending");
        pendingRequests[userId] = msg.sender;
        emit RequestUserData(userId, msg.sender);
    }

    function fulfillUserData(uint256 userId, string calldata response) external onlyOwner {
        address requester = pendingRequests[userId];
        require(requester != address(0), "Request not found");

        // Notify the requester
        (bool success, ) = requester.call(
            abi.encodeWithSignature("fulfillUserData(uint256,string)", userId, response)
        );
        require(success, "Callback failed");

        emit FulfillUserData(userId, response);

        // Cleanup
        delete pendingRequests[userId];
    }
}
